Dependency Injection (DI) in ASP.NET Core is a powerful design pattern that helps you create loosely coupled, testable, and maintainable applications. It allows you to inject dependencies (like services or repositories) into classes instead of hard-coding them, making your code more modular and easier to test.

Here’s how it works in ASP.NET Core:

---

### 1. **What is Dependency Injection?**
Dependency Injection is a technique where a class does not create its dependencies directly. Instead, the dependencies are *provided* (injected) from outside.

For example, instead of creating a `UserService` inside a controller, the controller receives it through a constructor.

---

### 2. **How ASP.NET Core Implements DI**
ASP.NET Core comes with a built-in **Inversion of Control (IoC) container** that manages the lifecycle of your services.

#### Key Concepts:
- **Services**: Interfaces or classes that provide functionality (e.g., `IEmailService`, `IMyService`).
- **Container**: A built-in service provider that creates and manages instances of services.
- **Lifetimes**: How long a service instance lives (e.g., singleton, scoped, transient).

---

### 3. **Registering Services**
You register services in the `Program.cs` (or `Startup.cs` in older versions) using the `IServiceCollection` interface.

```csharp
var builder = WebApplication.CreateBuilder(args);

// Register services
builder.Services.AddTransient<IEmailService, EmailService>();
builder.Services.AddScoped<IUserService, UserService>();
builder.Services.AddSingleton<IDatabaseContext, DatabaseContext>();

var app = builder.Build();
```

#### Service Lifetimes:
- **Transient**: New instance every time it's requested.
- **Scoped**: One instance per request (in web apps, one per HTTP request).
- **Singleton**: One instance for the entire application lifetime.

---

### 4. **Injecting Dependencies**
You inject services into classes (e.g., controllers, services, middleware) using **constructor injection**.

#### Example: Controller with Injected Service

```csharp
[ApiController]
[Route("[controller]")]
public class UsersController : ControllerBase
{
    private readonly IUserService _userService;

    // Constructor injection
    public UsersController(IUserService userService)
    {
        _userService = userService;
    }

    [HttpGet]
    public IActionResult Get()
    {
        var users = _userService.GetAll();
        return Ok(users);
    }
}
```

When the `UsersController` is created, the DI container automatically resolves and passes an instance of `IUserService`.

---

### 5. **How the DI Container Works**
1. When a class needs a dependency, the container checks if it’s registered.
2. If it is, the container creates an instance based on the registration (using the correct lifetime).
3. The instance is passed to the class (usually via constructor).
4. The container also handles nested dependencies recursively.

---

### 6. **Why Use DI?**
- **Testability**: You can inject mock objects during unit testing.
- **Loose Coupling**: Classes depend on abstractions, not concrete implementations.
- **Reusability**: Services can be used across different parts of the app.
- **Maintainability**: Easier to swap implementations or update services.

