### How Dependency Injection Works in ASP.NET Core

#### 1. **Registering Services**
In ASP.NET Core, you register services (like repositories, APIs, or utility classes) with the built-in **service container** (also called the **dependency injection container**) in the `Startup.cs` file (or `Program.cs` in .NET 6+) using the `IServiceCollection` interface.

```csharp
// In Program.cs (or Startup.cs)
var builder = WebApplication.CreateBuilder(args);

// Register services
builder.Services.AddScoped<IWeatherService, WeatherService>();
builder.Services.AddSingleton<ILogger, ConsoleLogger>();
builder.Services.AddTransient<IEmailService, EmailService>();
```

Here’s what each lifetime means:
- **Scoped**: A single instance per request (e.g., per HTTP request in a web app).
- **Singleton**: One instance for the entire application lifetime.
- **Transient**: A new instance every time the service is requested.

#### 2. **Defining Interfaces and Implementation**
You typically define an interface and implement it in a class.

```csharp
public interface IWeatherService
{
    Task<WeatherData> GetWeatherAsync(string city);
}

public class WeatherService : IWeatherService
{
    public Task<WeatherData> GetWeatherAsync(string city)
    {
        // Implementation
    }
}
```

#### 3. **Injecting Dependencies into Classes**
You can inject services into controllers, services, or other classes using **constructor injection**.

```csharp
public class WeatherController : ControllerBase
{
    private readonly IWeatherService _weatherService;

    // Constructor injection
    public WeatherController(IWeatherService weatherService)
    {
        _weatherService = weatherService;
    }

    [HttpGet("weather")]
    public async Task<IActionResult> GetWeather(string city)
    {
        var weather = await _weatherService.GetWeatherAsync(city);
        return Ok(weather);
    }
}
```

ASP.NET Core automatically resolves the `IWeatherService` from the service container and passes it to the controller via the constructor.

#### 4. **Automatic Resolution**
When a controller or class is created by the framework, the DI container:
- Looks at the constructor parameters.
- Finds the registered service that matches the type.
- Creates an instance (if needed) and injects it.

#### 5. **Built-in Services**
ASP.NET Core includes many built-in services (like `IConfiguration`, `ILogger`, `IHostApplicationLifetime`) that are registered by default.

