### 3. **Service Lifetimes**
ASP.NET Core supports three service lifetimes:

| Lifetime | Description |
|--------|-------------|
| **Transient** | Created each time the service is requested. Use for stateless services. |
| **Scoped** | Created once per client request (in a web app). Shared across all components in the same request. |
| **Singleton** | Created once, shared across the entire application. |

> Example:
```csharp
builder.Services.AddSingleton<IUserService, UserService>();
builder.Services.AddScoped<ILogger, Logger>();
builder.Services.AddTransient<IEmailSender, EmailSender>();
```

